import React from "react";
import "./style.css";

function Card(props) {
  return (
    <div className="card">
      <div className="img-container">
        <div
          role="img"
          aria-label="click item"
        />
        <img alt={props.name} src={props.image} onClick={() => props.handleClick(props.id)} />
      </div>

    </div>
  );
}


export default Card;
